unichar_t ff_unicode_tolower(unichar_t ch) {
    const struct utypecasing* rec = get_casing(ch);
    return (unichar_t)(((int32_t)ch) + rec->lower);
}

unichar_t ff_unicode_toupper(unichar_t ch) {
    const struct utypecasing* rec = get_casing(ch);
    return (unichar_t)(((int32_t)ch) + rec->upper);
}

unichar_t ff_unicode_totitle(unichar_t ch) {
    const struct utypecasing* rec = get_casing(ch);
    return (unichar_t)(((int32_t)ch) + rec->title);
}

unichar_t ff_unicode_tomirror(unichar_t ch) {
    const struct utypecasing* rec = get_casing(ch);
    if (rec->mirror == 0) {
        return 0;
    }
    return (unichar_t)(((int32_t)ch) + rec->mirror);
}

